import { ReactComponent as parking } from './parking.svg';
import { ReactComponent as elevator } from './elevator.svg';
import { ReactComponent as gym } from './gym.svg';
import { ReactComponent as swimmingPool } from './swimmingPool.svg';
import { ReactComponent as petsFriendly } from './petsFriendly.svg';
import { ReactComponent as indoorWasher } from './indoorWasher.svg';

export default {
  parking,
  elevator,
  gym,
  swimmingPool,
  petsFriendly,
  indoorWasher,
};
